# ÊéßÂà∂Èù¢Êùø
external-controller: 0.0.0.0:9090
secret: ""
external-ui: ui
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"

# ÂåπÈÖçËøõÁ®ã always/strict/off
find-process-mode: strict
global-client-fingerprint: chrome
keep-alive-idle: 600
keep-alive-interval: 30

# Á≠ñÁï•ÁªÑÈÄâÊã©ÂíåfakeipÁºìÂ≠ò
profile:
  store-selected: true
  store-fake-ip: true
  
# ÊµÅÈáèÂóÖÊé¢
sniffer:
  enable: true
  sniff:
    HTTP:
      ports: [80, 8080-8880]
      override-destination: true
    TLS:
      ports: [443, 8443]
    QUIC:
      ports: [443, 8443]
  force-domain:
    - +.v2ex.com
  skip-domain:
    - "dlg.io.mi.com"
    - "+.push.apple.com"
    - "+.apple.com"
    
# ‰ª£ÁêÜÊ®°Âºè
tun:
  enable: true
  stack: mixed
  mtu: 9000
  dns-hijack:
    - "any:53"
    - "tcp://any:53"
  auto-route: true
  auto-redirect: true
  auto-detect-interface: true
  
# DNSÊ®°Âùó
dns:
  enable: true
  listen: 0.0.0.0:1053
  ipv6: false
  respect-rules: true
  # Ê®°ÂºèÂàáÊç¢ redir-host / fake-ip
  enhanced-mode: fake-ip
  fake-ip-range: 28.0.0.1/8
  # Ê®°ÂºèÂàáÊç¢ whitelist/blacklist 
  # ÈªëÂêçÂçïÊ®°ÂºèË°®Á§∫Â¶ÇÊûúÂåπÈÖçÊàêÂäüÂàô‰∏çËøîÂõû Fake-IP, ÁôΩÂêçÂçïÊ®°ÂºèÊó∂Âè™ÊúâÂåπÈÖçÊàêÂäüÊâçËøîÂõû Fake-IP
  fake-ip-filter-mode: blacklist
  fake-ip-filter:
    - "+.lan"
    - "+.local"
    - geosite:private
    - geosite:cn
  default-nameserver:
    - 223.5.5.5
    - 119.29.29.29
  proxy-server-nameserver:
    - 223.5.5.5
    - 119.29.29.29
  nameserver:
    - 223.5.5.5
    - 119.29.29.29
  nameserver-policy:
    "rule-set:private_domain,cn_domain":
    - 223.5.5.5
    - 119.29.29.29
    "rule-set:geolocation-!cn":
      - "https://dns.cloudflare.com/dns-query"
      - "https://dns.google/dns-query"
 
